import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Pixelify } from "react-pixelify";

const src = require("./image.png");

class MyImg extends React.Component {
  renderSlider(i){
    return <SliderPage value={i} />;
  }

  render() {
    return (
      <Pixelify
        src={src}
        width={250}
        height={250}
        centered={true}
        pixelSize={5}
      />
    );
  }
}

class SliderPage extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div className="my-5">
        <label htmlFor="customRange1">Pixelation: {this.props.value}</label>
        <input type="range" className="custom-range" id="customRange1" />
      </div>
    )
  }
}


class App extends React.Component {
  render() {
    return (
      <div className="app">
        <div className="app-img">
          <MyImg />
        </div>
        <div className="img-fields">
          <div>
          <SliderPage />
          </div>
        </div>
      </div>
    );
  }
}


// ======================================
ReactDOM.render(
  <App />,
  document.getElementById('root')
);
